function showLargeModal(){var modal=document.getElementById("accessKeys_modalDialog");modal.classList.remove("w-50");modal.classList.add("w-75")}function showMiddleModal(){var modal=document.getElementById("accessKeys_modalDialog");modal.classList.remove("w-75");modal.classList.add("w-50")}function setModalTitle(title){$("#accessKeys_modalTitle").empty();$("#accessKeys_modalTitle").append(title)}function setModalBody(viewData){$("#accessKeys_modalBody").html(viewData)}function showAccessKeysListModal(){showLargeModal();let productName=$("#accessKey_productName").val();setModalTitle(`Access keys list for product '${productName}'`)}function showModal(){$("#accessKeys_modal").modal({backdrop:"static"});$("#accessKeys_modal").modal("show")}function hideModal(){$("#accessKeys_modal").modal("hide")}function showAccessKeysList(productId,showModalFirst){$.ajax({type:"get",url:showProductAccessKeyTable+"?Selected="+productId,datatype:"html",contenttype:"application/json",cache:!1,success:function(viewData){setModalBody(viewData)}}).done(function(){showAccessKeysListModal();showModalFirst===!0&&showModal()})}function showNewAccessKeyModal(url,openModal){$.ajax({type:"get",url:url,datatype:"html",contenttype:"application/json",cache:!1,success:function(viewData){setModalBody(viewData)}}).done(function(){openModal===!0&&showModal();showMiddleModal();setModalTitle("New access key")})}function changeAccessKey(url,id){$.ajax({type:"GET",url:`${url}?SelectedKey=${id}`,cache:!1,"async":!0,success:function(viewData){setModalBody(viewData)}}).done(function(){showModal();showMiddleModal();setModalTitle(`Edit access key '${id}'`)})}function deleteAccessKey(id){showDeletionConfirmationModal("Removing access key",`Do you really want to remove selected access key '${id}'?`,function(){$.ajax({type:"POST",url:getRemoveAccessKeyURL(id),cache:!1,"async":!0,success:function(viewData){$("#accessKeysTable").html(viewData)}})})}function blockAccessKey(url,id){$.ajax({type:"POST",url:url+"?SelectedKey="+id,cache:!1,"async":!0,success:function(viewData){$("#accessKeysTable").html(viewData)}})}function getRemoveAccessKeyURL(selectedKeyId){let isAllAccessKeysTable=document.getElementById("accessKeys_productColumn"),url;if(isAllAccessKeysTable!=undefined)url=`@Html.Raw(Url.Action(nameof(AccessKeysController.RemoveAccessKeyFromAllTable), ViewConstants.AccessKeysController))?SelectedKey=${selectedKeyId}&AllProducts=${(!1).checked}`;else url=`@Html.Raw(Url.Action(nameof(AccessKeysController.RemoveAccessKeyFromProductTable), ViewConstants.AccessKeysController))?SelectedKey=${selectedKeyId}`;return url}